import Head from 'next/head';
import Header from "./Header";


const Layout = (props) => {
    return ( < div >

        < Head >
        < title > APP Merca en Linea < /title> 
        < link rel = "stylesheet"
        href = "https://bootswatch.com/4/flatly/bootstrap.min.css" / >
        </Head> 
        <Header/>
        { props.children }
     < / div>);
};

export default Layout;
